<html><body><div text=align:justify><div align=center><H2 style="margin-left: auto; margin-right: auto;"> ХАРАКТЕРИСТИКА </H2> </div><br>	Тамара Рубеновна Князева родится двадцать седьмого августа 2674. <br><p>Двадцать пятого июня 1990 устроится на работу в Фонд на должность  начальника военного оркестра. </p><p>	Окончательно уволится двадцать девятого ноября 2885. </p><p>Дата созадния документа 12.02.2023</p></div></body></html>
